import React from 'react';

const PersonalInfo = () => {
  return (
    <section className="info-personal" style={{ background: '#f2f2f2', padding: '20px', borderRadius: '10px', boxShadow: '3px 3px 5px 0px rgba(0,0,0,0.5)', margin: '20px' }}>
      <h2>Informacion Personal</h2>
      <p>Nombre: Cristian Ronaldo</p>
      <p>Edad: 37 años</p>
      <p>Ubicacion: Dubai</p>
      <p>Descripción: Soy un amante de la tecnologia, la programacion y el futbol de vez en cuando.</p>
    </section>
  );
}

export default PersonalInfo;
